import { Schema, model } from 'mongoose'


const userSchema = new Schema({
    name: {
        type: String,
        required: true,
        trim: true
    },
    email: {
        type: String,
        required: true,
        trim: true
    },
    password: {
        type: String,
        required: true,

    },
},
    {
        versionKey: false,
        timestamps: true
    })

export default model('User', userSchema)
